import React from 'react'

function App() {
  const list = ["apples", "bananas", "grapes", "oragnes"];
  return (
    <div>
      {list.map((item, index) => {
        <h1>{key = { index } `index  of ${item} is ${index} `}</h1>
      })}

    </div>
  )
}

export default App
